import { Food } from "../models/Food";
import { TestListElementBox } from "../styles/OrderTrans";

export const SummaryList = ({ id, name, amount, price }: Food) => {
  return (
    <>
      {data.map(() => (
        <TestListElementBox>{data.id}</TestListElementBox>
      ))}
    </>
  );
};
